"35738":{"id":"35738","name":"Premonição","slug":"premonicao","original_title":"Éternelle","overview":"Uma mulher misteriosa acorda no hospital. Ela não tem identidade e perdeu a memória, mas apresenta poderes sobrenaturais. O Eurochannel estreia Premonição, um thriller sobrenatural no qual uma conspiração de saúde pública e uma caça voraz a um homem se combinam para oferecer uma experiência emocionante.","first_air_date":"2009-07-30","episode_run_time":52,"vote_average":4.4,"number_of_seasons":1,"number_of_episodes":6,"created_by":["Joël Houssin"],"production_companies":["Alizés Films","RTL-TVi","Be-FILMS","CNC"],"genres":["Mistério","Drama","Sci-Fi & Fantasy"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/fjWqiNe0mrn1BxcJcbSuciuX1h3.jpg","poster_path":"https://image.tmdb.org/t/p/original/596ljbhEOL0LgM61tOwyyxh2YHt.jpg","cast":["Claire Keim","Guillaume Cramoisan","Boris Terral","Antoine Duléry","Serge Riaboukine"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/596ljbhEOL0LgM61tOwyyxh2YHt.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/596ljbhEOL0LgM61tOwyyxh2YHt.jpg","air_date":"2009-07-30","episode_count":6,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Episódio 1","overview":"Em uma noite chuvosa em Paris, o médico Yann Voline atropela uma jovem nua. Este acidente vai virar sua vida de cabeça para baixo.","air_date":"2009-07-30","runtime":52,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"2":{"name":"Episódio 2","overview":"A jovem não se lembra de nada, mas sabe tudo sobre Yann. Ela absorveu as memórias do médico como se fossem suas. E também consegue ler a mente de outras pessoas.","air_date":"2009-07-30","runtime":52,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"3":{"name":"Episódio 3","overview":"Uma bactéria desconhecida é encontrada no sangue da jovem. Martin, o técnico de laboratório, é infectado e foge.Um homem estranho aparece no hospital. Ele afirma ser o pai da mulher.","air_date":"2009-08-06","runtime":52,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"4":{"name":"Episódio 4","overview":"O suposto pai carrega o fungo tóxico de uma planta que desapareceu há 4.000 anos. Ele saqueia o laboratório antes de ser contido. Os especialistas da OMS assumem o controle do hospital e suas descobertas estão muito além do conhecimento científico.","air_date":"2009-08-06","runtime":52,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"5":{"name":"Episódio 5","overview":"Yann e a jovem saíram em busca de uma estudante do ensino médio que está desaparecida há seis anos. Eles a encontram em estado crítico e só pode ser salva pela misteriosa mulher.","air_date":"2009-08-13","runtime":52,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"6":{"name":"Episódio 6","overview":"A jovem desaparece.Yann a procura desesperadamente enquanto a estudante é levada às pressas para o hospital em coma profundo. Os exames de sangue mostram que ela foi contaminada com a bactéria misteriosa.","air_date":"2009-08-13","runtime":52,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0}}}}},
