"237316":{"id":"237316","name":"Casamento às Cegas: Reino Unido","slug":"casamento-as-cegas-reino-unido","original_title":"Love Is Blind: UK","overview":"Emma e Matt Willis apresentam a versão britânica deste experimento social no qual homens e mulheres buscam o amor e ficam noivos antes de se conhecerem cara a cara.","first_air_date":"2024-08-07","episode_run_time":0,"vote_average":6.6,"number_of_seasons":1,"number_of_episodes":12,"created_by":[],"production_companies":["CPL Productions"],"genres":["Reality"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/zXqjSkvpOtkr4qeHSnDBEVoqDV5.jpg","poster_path":"https://image.tmdb.org/t/p/original/1EPL2e0fon7P1GK1HlPXdeNMOY9.jpg","cast":["Emma Willis","Matt Willis"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/j2Y18pfIG7wZeDBUM7TIdvJLJ1X.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/j2Y18pfIG7wZeDBUM7TIdvJLJ1X.jpg","air_date":"2024-08-07","episode_count":12,"overview":"N/A","vote_average":6,"episodes":{"1":{"name":"As cabines estão abertas","overview":"As cabines estão abertas para os solteiros e solteiras desta temporada. Enquanto uns escolhem parceiros e fazem conexões com calma, outros já começam dispostos a propor casamento.","air_date":"2024-08-07","runtime":57,"still_path":"https://image.tmdb.org/t/p/original/v0aneaRxdHCBQ2EJaYSo2IQNHrC.jpg","vote_average":0},"2":{"name":"Dois é bom, três é um triângulo","overview":"Enquanto as conexões se aprofundam, os solteiros começam a se abrir uns com os outros e compartilhar suas fragilidades. Mas será que todos realmente são o que dizem ser?","air_date":"2024-08-07","runtime":65,"still_path":"https://image.tmdb.org/t/p/original/A76OfUVYhjAVW2kAoPsMeq79wKN.jpg","vote_average":0},"3":{"name":"Ele está aqui por fama","overview":"Mais dois casais se preparam para o encontro cara a cara. Furiosa diante de uma alegação chocante, uma participante enfrenta a decisão mais difícil de sua vida.","air_date":"2024-08-07","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/jGKdnsbkRE6YpTzBQxvNW8N53Os.jpg","vote_average":0},"4":{"name":"A gente fez sexo... Duas vezes!","overview":"Dois triângulos amorosos se resolvem, mas uma das noivas já tem dúvidas. Os casais vão a Corfu para testar suas conexões.","air_date":"2024-08-07","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/uRMlQjnYdlmnLSD51B03gT7oAGN.jpg","vote_average":0},"5":{"name":"Eu cometi um erro","overview":"Os casais se encontram pela primeira vez. Dois participantes se reconectam, mas uma pessoa acaba ficando de lado.","air_date":"2024-08-14","runtime":41,"still_path":"https://image.tmdb.org/t/p/original/wIUu7Xw0rpKeVZDdjvlnSdUWLnz.jpg","vote_average":6},"6":{"name":"Traiu uma vez, vai trair sempre","overview":"No último dia em Corfu, os casais falam sobre futuro e passado. Mas, para algumas pessoas, são as pressões do presente que trazem complicações.","air_date":"2024-08-14","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/ngbmDsJwqMiqBwcXoy9qcPgdnIY.jpg","vote_average":0},"7":{"name":"Ela é boa o suficiente?","overview":"De volta ao Reino Unido, os casais adentram no mundo um do outro e conhecem familiares e amigos. Eles recebem apoio de uns e questionamentos de outros.","air_date":"2024-08-14","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/exEvM8dSIHcInJltGQbfDMoGpPp.jpg","vote_average":0},"8":{"name":"Adivinhem quem voltou?","overview":"Os casais se encontram com outros participantes, mas ainda tem um ou outro rosto desconhecido no meio da multidão. O retorno de um solteiro abala algumas pessoas.","air_date":"2024-08-14","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/17PwIhZ1wE2JHQiajhoDUvmzMLC.jpg","vote_average":0},"9":{"name":"Ele quer fazer um acordo pré-nupcial","overview":"O grande dia está quase chegando e as coisas ficam cada vez mais sérias. Enquanto experimentam os trajes do casamento, algumas pessoas começam a ter dúvidas.","air_date":"2024-08-14","runtime":72,"still_path":"https://image.tmdb.org/t/p/original/mdoMKoWg0j9Hf3v9ymKav6tU8G3.jpg","vote_average":0},"10":{"name":"Te vejo no altar","overview":"Após as despedidas de solteiro e solteira, é hora de decidir se a jornada está chegando ao fim... ou se está só começando.","air_date":"2024-08-21","runtime":69,"still_path":"https://image.tmdb.org/t/p/original/r4TjTebPsPEiSvHLYF6xSdPENUI.jpg","vote_average":0},"11":{"name":"Não estamos prontos","overview":"Os casais restantes se encontram no altar para tomar uma decisão que mudará suas vidas para sempre.","air_date":"2024-08-21","runtime":66,"still_path":"https://image.tmdb.org/t/p/original/bVkHSjLysh123rWnvuBqhuXqClU.jpg","vote_average":0},"12":{"name":"Reencontro","overview":"Um ano após os casamentos, Emma e Matt apresentam os seis casais e um convidado surpresa para revelar todos os dramas das cabines até os dias de hoje.","air_date":"2024-08-26","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/5vuxDzfaGaqMje5bEwWpWLNA2W6.jpg","vote_average":0}}}}},
