"206686":{"id":"206686","name":"Chicken Nugget","slug":"chicken-nugget","original_title":"닭강정","overview":"Após entrar em uma máquina estranha, uma mulher é transformada em um nugget de frango! Agora, seu pai e seu admirador precisam embarcar em uma aventura para salvá-la.","first_air_date":"2024-03-15","episode_run_time":0,"vote_average":6.1,"number_of_seasons":1,"number_of_episodes":10,"created_by":["이병헌"],"production_companies":["Studio N","PLUSMedia Entertainment"],"genres":["Comédia","Mistério","Sci-Fi & Fantasy"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/7pg8P17yImSmR7z5QO3nF0d7RB1.jpg","poster_path":"https://image.tmdb.org/t/p/original/g4hSAfG5HQgt65Tvwz1N5Ml6W0d.jpg","cast":["안재홍","류승룡","김유정"],"trailer":"e9Y7F3SGUks","seasons":{"1":{"name":"Minissérie","poster_path":"https://image.tmdb.org/t/p/original/fgHas8aGqjz1Xwr0pC9hy1DNMSf.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/fgHas8aGqjz1Xwr0pC9hy1DNMSf.jpg","air_date":"2024-03-15","episode_count":10,"overview":"N/A","vote_average":8.2,"episodes":{"1":{"name":"Episódio 1","overview":"Visitando o escritório do pai, Choi Min-ah entra em uma máquina estranha e passa por uma transformação. Choi Sun-man e Ko Baek-joong se desesperam em busca de respostas.","air_date":"2024-03-15","runtime":32,"still_path":"https://image.tmdb.org/t/p/original/x98wkGz96AGJ9olSZVjIpP2Uxn1.jpg","vote_average":8},"2":{"name":"Episódio 2","overview":"Sun-man e Baek-joong procuram o homem que entregou a máquina. Logo eles descobrem um cientista que pode saber qual é a origem da máquina.","air_date":"2024-03-15","runtime":32,"still_path":"https://image.tmdb.org/t/p/original/xmqbV2eiRHz0F1UO5L5Bxt3RGpE.jpg","vote_average":8},"3":{"name":"Episódio 3","overview":"Baek-joong pede ajuda a sua ex para encontrar Min-ah entre os nuggets. Em busca de outra máquina, Sun-man investiga o desaparecimento do Dr. Yoo In-won.","air_date":"2024-03-15","runtime":32,"still_path":"https://image.tmdb.org/t/p/original/mRkPYYyuai1z1u7Szn54dt9bv74.jpg","vote_average":0},"4":{"name":"Episódio 4","overview":"Depois de uma noite difícil, Baek-joong e Sun-man encontram o antigo assistente de laboratório do Dr. Yoo. No escritório, eles descobrem que alguém pegou a máquina.","air_date":"2024-03-15","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/rtJQtIWVdgWJQ2UesVI9Mtg5Bg3.jpg","vote_average":8},"5":{"name":"Episódio 5","overview":"Depois de roubar a máquina, Yoo Tae-man traz de volta uma pessoa desaparecida. Baek-joong e Sun-man se reúnem com dois homens, sempre mantendo a cautela.","air_date":"2024-03-15","runtime":28,"still_path":"https://image.tmdb.org/t/p/original/sMUWyfJB3uD8cceMImARZoysdy2.jpg","vote_average":9},"6":{"name":"Episódio 6","overview":"Baek-joong e Sun-man descobrem as histórias de Tae-man e do Dr. Yoo com as máquinas e como uma delas chegou à Mais que Máquinas.","air_date":"2024-03-15","runtime":28,"still_path":"https://image.tmdb.org/t/p/original/3zHCgvjIcEPMCBIgMHGjBT3McPi.jpg","vote_average":0},"7":{"name":"Episódio 7","overview":"Ignorando os pedidos de salvar Min-ah, o Dr. Yoo aprisiona Sun-man e Baek-joong. Baekjung encontra sua máquina perdida com o vídeo viral de Baek-joong.","air_date":"2024-03-15","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/nfL3mtEizs7E3dMimito2doftN6.jpg","vote_average":0},"8":{"name":"Episódio 8","overview":"Baekjung e seu grupo vão atrás da máquina perdida. Eles encontram Sun-man e Baek-joong confrontando o Dr. Yoo e Tae-man.","air_date":"2024-03-15","runtime":35,"still_path":"https://image.tmdb.org/t/p/original/uP0yszHVdCab8YcOuQHWAxbGrwl.jpg","vote_average":7},"9":{"name":"Episódio 9","overview":"Baekjung oferece ajuda, mas, ainda assim, começa uma briga. Uma proposta para salvar Min-ah preocupa Sun-man e Baek-joong.","air_date":"2024-03-15","runtime":29,"still_path":"https://image.tmdb.org/t/p/original/PmPnryDZN1YEjbYlpPYnVoeNhP.jpg","vote_average":0},"10":{"name":"Episódio 10","overview":"Após a partida de Baekjung, Baek-joong e Sun-man esperam por décadas. Ao voltar, Baekjung propõe uma decisão difícil sobre o destino de Min-ah.","air_date":"2024-03-15","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/a1IO7Oy3NJKqvQwLXuk78HgmPdp.jpg","vote_average":9}}}}},
