"88329":{"id":"88329","name":"Gavião Arqueiro","slug":"gaviao-arqueiro","original_title":"Hawkeye","overview":"O ex-vingador Clint Barton tem uma missão aparentemente simples: voltar para sua família no Natal. Será possível? Talvez com a ajuda de Kate Bishop, uma arqueira de 22 anos que sonha em se tornar uma super-heroína. Os dois são forçados a trabalhar juntos quando uma presença do passado de Barton ameaça descarrilar muito mais do que o espírito festivo.","first_air_date":"2021-11-24","episode_run_time":0,"vote_average":7.852,"number_of_seasons":1,"number_of_episodes":6,"created_by":["Jonathan Igla"],"production_companies":["Marvel Studios","Kevin Feige Productions"],"genres":["Drama","Comédia","Action & Adventure"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/1R68vl3d5s86JsS2NPjl8UoMqIS.jpg","poster_path":"https://image.tmdb.org/t/p/original/scOgJfqpZnGkGmVrfTZnH32GLK8.jpg","cast":["Jeremy Renner","Hailee Steinfeld","Tony Dalton","Alaqua Cox","Fra Fee"],"trailer":"C-Wi9qu--0k","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/62qfVDg4VK3kqZFxrRztPqSbal4.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/62qfVDg4VK3kqZFxrRztPqSbal4.jpg","air_date":"2021-11-24","episode_count":6,"overview":"N/A","vote_average":7.4,"episodes":{"1":{"name":"Nunca Conheça seus Heróis","overview":"Kate Bishop, uma arqueira habilidosa, cai no meio de uma conspiração criminosa. É uma questão de tempo até que os caminhos dela e Clint Barton se cruzarem, tirando o Gavião Arqueiro da aposentadoria.","air_date":"2021-11-24","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/AwCNTaG7VPVwaBRSZkvQUMEfyuZ.jpg","vote_average":7.013},"2":{"name":"Esconde-Esconde","overview":"Clint Barton quer desesperadamente chegar em casa a tempo para o Natal. Mas primeiro ele precisa ajudar Kate Bishop a se livrar da Gangue do Agasalho e de um caso de assassinato.","air_date":"2021-11-24","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/v6DjX5jATXUpkILMFMEOR61PWr5.jpg","vote_average":7.125},"3":{"name":"Ecos","overview":"Depois de escapar por pouco da Gangue do Agasalho e de sua assustadora líder Maya Lopez. Clint e Kate trabalham juntos para encontrar respostas. No entanto, com cada passo dado, eles se encontram mais envolvidos em uma conspiração criminosa que não para de crescer.","air_date":"2021-12-01","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/4JIxm0YFv0d8nMEwmMBrOOs2H0k.jpg","vote_average":7.3},"4":{"name":"Parceiros, Certo?","overview":"Segredos são revelados sobre o principal suspeito do mistério enquanto a dura verdade sobre o passado do Gavião Arqueiro vem à tona. Mas enquanto a parceria de Clint e Kate finalmente se consolida, seus esforços para desvendar mais da história resultam numa batalha confusa não contra um, mas contra dois oponentes.","air_date":"2021-12-08","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/akWRlpcSbfjfnqaP8l3PH8fgUuh.jpg","vote_average":7.3},"5":{"name":"Ronin","overview":"Após um conflito entre Clint e Kate, a jovem arqueira está prestes a abandonar o sonho de se tornar uma heroína. Enquanto isso, Clint se prepara para enfrentar a Gangue do Agasalho assumindo os erros de seu passado.","air_date":"2021-12-15","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/fWBdxjTW3LnNvieDzHqUF30CnGE.jpg","vote_average":7.8},"6":{"name":"Então Já É Natal?","overview":"A parceria de Clint e Kate é testada quando eles lidam com as consequências devastadoras de terem exposto a conspiração.","air_date":"2021-12-22","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/nXuI42V8HgmyMlewU2tiOEEjKsC.jpg","vote_average":7.6}}}}},
