"212512":{"id":"212512","name":"Vida de Casal","slug":"vida-de-casal","original_title":"Mammals","overview":"Revelações e segredos vêm à tona à medida que a complexidade do casamento moderno e da fidelidade são expostos. Em um mundo de oito bilhões, o que acontece depois que encontramos \"aquela pessoa\"? Podemos permanecer fiéis às promessas que nos esforçamos para cumprir enquanto estamos em uma VIDA DE CASAL?","first_air_date":"2022-11-11","episode_run_time":30,"vote_average":5.7,"number_of_seasons":1,"number_of_episodes":6,"created_by":["Jez Butterworth","James Richardson"],"production_companies":["Street Hassle","Vertigo Films"],"genres":["Comédia","Drama"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/kyjQv6RtTOVWsMRR0aC8plhMMo2.jpg","poster_path":"https://image.tmdb.org/t/p/original/kj4A4MilkbFpCqTcl9u2vY4Iigj.jpg","cast":["James Corden","Colin Morgan","Melia Kreiling","Sally Hawkins"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/kj4A4MilkbFpCqTcl9u2vY4Iigj.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/kj4A4MilkbFpCqTcl9u2vY4Iigj.jpg","air_date":"2022-11-11","episode_count":6,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Episódio 1","overview":"O mundo de Jamie é virado de cabeça para baixo quando um feriado idílico resulta em uma perda trágica que expõe segredos chocantes sobre sua esposa, Amandine.","air_date":"2022-11-11","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/eik4XIkBec73S7eDYjm9AmferRx.jpg","vote_average":0},"2":{"name":"Episódio 2","overview":"A busca por 'Paul' continua enquanto Jamie tenta conter a situação. Com a ajuda de seu cunhado Jeff, coisas ainda mais chocantes são descobertas. Enquanto isso, Amandine procura distração em sua paixão pelo violino que a aproxima de seu professor.","air_date":"2022-11-11","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/eAHT9jCR4tI0w46RG2dbNtv5w9e.jpg","vote_average":0},"3":{"name":"Episódio 3","overview":"Jamie luta para equilibrar a vida com a abertura de seu primeiro restaurante. Ele explode sob a pressão e as consequências das ações de Amandine vêm à tona. Enquanto isso, o casamento de Jeff e Lue se arrasta ainda mais.","air_date":"2022-11-11","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/gqVFfWriSf3shbkI3MRqRZlMHF1.jpg","vote_average":0},"4":{"name":"Episódio 4","overview":"Antes do caos, conhecemos o jovem Jamie que conhece Amandine enquanto trabalha no super iate do noivo bilionário dela. Eles arriscam tudo para apostar no amor, enquanto Amandine guarda um segredo.","air_date":"2022-11-11","runtime":28,"still_path":"https://image.tmdb.org/t/p/original/tw8IN2Djzn2VI9ubsWv6JdGKCEu.jpg","vote_average":0},"5":{"name":"Episódio 5","overview":"Jamie passa um tempo na fazenda e descobre a chocante identidade de 'Paul'. Lue e Jeff continuam a evitar os problemas em seu casamento. Enquanto Lue foge para a fantasia, Jeff se distrai em Cambridge.","air_date":"2022-11-11","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/xqUKmPyCrNusYUNqJrxNX5jyzoZ.jpg","vote_average":0},"6":{"name":"Episódio 6","overview":"O plano de Amandine é revelado quando Jamie descobre a verdadeira razão por trás das ações dela. As histórias de Lue e Jeff vêm à tona quando uma revelação causa um grande choque em ambas as famílias.","air_date":"2022-11-11","runtime":28,"still_path":"https://image.tmdb.org/t/p/original/A9C0tMQbdCWCYTmgTR75q71HO8m.jpg","vote_average":0}}}}},
