"231000":{"id":"231000","name":"A Casa de Moda","slug":"a-casa-de-moda","original_title":"La Maison","overview":"A alta moda se mistura com o drama nesta visão dos bastidores de uma icônica maison de alta-costura francesa. Quando a dinastia familiar por trás da maison é envolvida em um escândalo, ela deve encontrar uma maneira de se reinventar, ou será destruída pelos rivais.","first_air_date":"2024-09-19","episode_run_time":0,"vote_average":7.1,"number_of_seasons":1,"number_of_episodes":10,"created_by":["José Caltagirone","Valentine Milville"],"production_companies":["TOA - The Originals of America","HB Entertainment"],"genres":["Drama"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/idnog5IYzIbch6Z7HgDt0YXyf9F.jpg","poster_path":"https://image.tmdb.org/t/p/original/g1iHzQRVfTWth8cXEA5r5wKsqMX.jpg","cast":["Lambert Wilson","Amira Casar","Carole Bouquet","Zita Hanrot","Pierre Deladonchamps"],"trailer":"KNDyQPdHXiQ","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/8k8GZSnxPPIGsc23gDZTR5Ruc4p.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/8k8GZSnxPPIGsc23gDZTR5Ruc4p.jpg","air_date":"2024-09-19","episode_count":10,"overview":"N/A","vote_average":6.1,"episodes":{"1":{"name":"17 segundos","overview":"Antes de seu desfile na Semana de Moda de Paris, a reverenciada Maison Ledu é centro de um escândalo. As jovens designers Paloma e Ye-Ji aproveitam o momento.","air_date":"2024-09-19","runtime":57,"still_path":"https://image.tmdb.org/t/p/original/KdPBpog0s0FmSXqMGGdrNrT2KX.jpg","vote_average":6.5},"2":{"name":"Nepo Baby","overview":"Vincent e Perle se enfrentam para decidir o futuro da Maison LEDU. Paloma e Ye-Ji chegam a uma encruzilhada criativa e pessoal.","air_date":"2024-09-19","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/s8xqL3QFqfg4TEfZF0PAZTWvYZ0.jpg","vote_average":6.5},"3":{"name":"A foto de família","overview":"A tempestade midiática diminui, e chega a hora de tomar decisões difíceis. Paloma luta para achar seu lugar em uma família destruída por alianças egoístas.","air_date":"2024-09-26","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/hqAzRJYfUIhZScNMJrDKFJRGPUr.jpg","vote_average":6},"4":{"name":"A divorciada","overview":"Paloma prepara seu primeiro desfile na Ledu. Sob imensa pressão, ela deve descobrir em quem pode confiar.","air_date":"2024-10-03","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/dAz4nSRI8yDTwVEOWa0QZLNi9Cy.jpg","vote_average":6},"5":{"name":"Tal pai, tal filha","overview":"Victor percebe que seu futuro é incerto. Paloma enfrenta a realidade da vida sob os holofotes—e o preço de sua posição.","air_date":"2024-10-10","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/f1MBylH4IX5fHYAmQNKqnkT7xoI.jpg","vote_average":6},"6":{"name":"Pedido na garrafa","overview":"Toda a família Ledu se reúne para o Natal, mas a alegria não dura muito, quando há uma reviravolta na festa.","air_date":"2024-10-17","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/3cDeoCK1dfCElenTYNdkQJoQgyf.jpg","vote_average":5.5},"7":{"name":"La vie en rose","overview":"Paloma fica na Bretanha para passar mais tempo com Vincent, o que irrita Ye-Ji e sua equipe no estúdio.","air_date":"2024-10-24","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/jRN2bGbyH71mC2vR7EI8fUwkvT0.jpg","vote_average":6},"8":{"name":"A maré muda","overview":"Alguns dias antes do desfile, Paloma ainda não tem um plano criativo. Caroline está pronta para agir.","air_date":"2024-10-31","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/5IYyekyTR0aUiBTfnwbBTSM7nV1.jpg","vote_average":6},"9":{"name":"Ledu ou não Ledu","overview":"Como um ato final de rebeldia, a Maison Ledu, unida, faz uma última tentativa. Victor se sente aprisionado.","air_date":"2024-11-07","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/mviGvsO8iEIpe0yjn8fQXs46cQ7.jpg","vote_average":6.5},"10":{"name":"A Ilha dos Mortos","overview":"As famílias Ledu e Rovel brigam pelo controle, e Paloma se arrisca.","air_date":"2024-11-14","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/fV54q3jmXCFZxQaL3TqO3Lugv16.jpg","vote_average":6}}}}},
